/**
    Solutons:
    we can use the merge sorting idea.we can get the size of the Linkedlist,and we will divide the original list into
    two part,and we will apply the divide method to the small problem until the size of the Linkedlist is less or equal
    to 2.then we will merge two sorted Linkedlist until the whole Linkedlist
*/
struct ListNode {
      int val;
      ListNode *next;
      ListNode(int x) : val(x), next(NULL) {}
 };
 void printList(ListNode* head){
    cout<<endl<<"-------------begin-----------------"<<endl;
    ListNode* rh = head;
    while(rh!=NULL){
        cout<<rh->val<<" ";
        rh = rh->next;
    }
    cout<<endl<<"-------------over------------------"<<endl;
}

ListNode* createNodeList(int* begin,int *end){
    ListNode* head = new ListNode(0);
    ListNode* p = head;
    while(begin < end){
        ListNode* tmp = new ListNode(*begin);
        tmp->next = 0;
        p->next = tmp;
        p = p->next;
        begin ++;
    }
    p = head;
    head = head->next;
    delete p;
    return head;
}
void freelistNode(ListNode *head){
    while(head){
        ListNode* p = head->next;
        delete head;
        head = p;
    }

}



class Solution {
    public:
    ListNode* sortList(ListNode* head) {
           if(head == 0)
                return 0;
           int size = listSize(head);
           if(size == 1)
                return head;
           return sortList1(head,size);
    }

    ListNode* sortList1(ListNode* head,int size){
        if(size == 0)
            return 0;
        if(size == 1){
            head->next= 0;
            return head;
        }
        if(size == 2){
            if(head->val > head->next->val){
                    int tmp = head->val;
                    head->val = head->next->val;
                    head->next->val = tmp;
            }
            head->next->next = 0;
            return head;
        }
        int n = size / 2;
        ListNode* p = getNthNode(head,n+1);
        ListNode* left = sortList1(head,n);
        ListNode* right = sortList1(p,size-n);
        ListNode* res = mergeTwoLists(left,right);
        return res;
    }

        int listSize(ListNode* head){
            if(head == NULL){
                return 0;
            }
            int n=0;
            ListNode* p = head;
            while(p->next){
                n++;
                p = p->next;
            }
            return n+1;
        }
        ListNode* getNthNode(ListNode* head,int n){
            if(head == NULL)
                return head;
            if(n == 1)return head;
            int m=1;
            ListNode* p = head;
            while(m<n){
                m++;
                p = p->next;
            }
            return p;
        }

        ListNode* mergeTwoLists(ListNode* l1, ListNode* l2) {
        ListNode*h1=l1,*h2 = l2;
        if(h1 == NULL)
            return h2;
        if(h2 == NULL)
            return h1;
        ListNode* head=new ListNode(0);
        ListNode *p = head;
        while(h1&&h2){
            int val1 = h1->val;
            int val2 = h2->val;
            if(val1 < val2){
                p->next = h1;
                h1 = h1->next;
            }
            else{
                p->next = h2;
                h2 = h2->next;
            }
            p = p->next;
        }
        if(h1!=NULL)
            p->next = h1;
        if(h2!= NULL)
            p->next = h2;
        p = head->next;
        delete head;
        return p;
}

};
